var requestBody = JSON.parse(request_body);
if (requestBody.journal_lines === null || requestBody.journal_lines === undefined) {
	return;
}
var lineItemsArray = requestBody.journal_lines;

lineItemsArray.forEach(function(object) {
	if (object.ledger_account !== null && object.ledger_account !== undefined) {
		var ledgerAccountObj = object.ledger_account;
		if (ledgerAccountObj['$key'] !== null) {
			delete ledgerAccountObj['$key'];
		}
		if (ledgerAccountObj['id'] !== null) {
			delete ledgerAccountObj['id'];
		}
		object = ledgerAccountObj;
	}
});
requestBody.journal_lines = lineItemsArray;
return {
	"request_vendor_body": JSON.stringify(requestBody),
	"continue": true
}
